import React from "react";
import "./MediaTile2.scss";

class MediaTile2 extends React.Component {
  render() {
    return (
      <section className="mediaTile2">
        <h1>
          CONVERSE X <br />
          THESOLOIST <br />
          ERX 260
        </h1>
        <h2>
          1980년대 레전드 농구화에
          <br />
          반항적인 펑크 락 스타일을 더해 모던하게 재해석한
          <br />
          더솔로이스트와의 콜라보레이션 'ERX 260'을 선보입니다.
        </h2>
        <button>구매하기</button>
      </section>
    );
  }
}

export default MediaTile2;
